def prepare_f(fingerprint):
    f = []
    keys = fingerprint.keys()
    for key in keys:
        if isinstance(fingerprint[key], list):
            f.append(",".join(map(str, fingerprint[key])))
        else:
            f.append(str(fingerprint[key]))
    return ";".join(f)


def prepare_fe(fp):
    fe = []
    for key, value in fp.items():
        fe.append(f"{key}:{value}")
    return fe


def get_fp(fe):
    fp = {}
    for i in fe:
        fp[i.split(':')[0]] = i.split(':')[1]
    return fp


def identify_platform(user_agent):
    platforms = {
        'iPhone': 'iPhone',
        'Intel Mac OS': 'MacIntel',
        'Windows': 'Win32',
        'Android': lambda: random.choice(['Linux aarch64', 'Linux armv7l'])  # 'Linux armv8'
    }
    return next(
        ((name() if callable(name) else name) for platform, name in platforms.items() if platform in user_agent),
        'Linux armv8')


